import { createApp } from 'vue'
import { fas } from "@fortawesome/vue-fontawesome";
import { library } from "@fortawesome/fontawesome-svg-core";
import { faPhone } from "@fortawesome/free-solid-svg-icons";
import App from './App.vue'

library.add(faPhone);

createApp(App)
.component("fa", fas)
.mount('#app')
